import { FaTrash } from "react-icons";

const ClientRow = ({ client }) => {
  return (
    <tr>
      <td>{client.name}</td>
      <td>{client.email}</td>
      <td>{client.phone}</td>
      <td>
        <button>
          <FaTrash />
        </button>
      </td>
    </tr>
  );
};

export default ClientRow;
